// import WazuhActive from '../components/wazuh_active';
// import WazuhInactive from '../components/wazuh_inactive';

function Home() {
  return (
      <div>
        <Navbar />
        <div className='back'>
        <WazuhAgents/>
        <h3 className='text-center'>Agents Details</h3>
        <div className="container m-5">
         
          <WazuhCombined/>
        
        </div>
        </div>
        </div>
  )
}

export default Home
